import React, {FC, useEffect, useState} from "react";
import { Account, Basket, DeliveryOption } from "api";
import { SetState } from "globals/state";
import { BsPlusLg, BsDashLg } from "react-icons/bs";
import Select from "components/Select";
import Option from "components/Select/Option";
import {
  PayPalScriptProvider,
  PayPalButtons,
  usePayPalScriptReducer
} from "@paypal/react-paypal-js";
import {Divider} from "primereact/divider";
import CheckoutButtons from "components/CheckoutButtons";
import {
  Wrapper,
  BasketDeliveryWrapper,
  Card,
  CardTitle,
  CardBody,
  ProductWrapper,
  ImageWrapper,
  ProductDetails,
  LeftWrapper,
  PriceWrapper,
  QuantityInput,
  PlusMinus,
  AddressInput,
  TextRight,
  ProductBill,
  BillElement
} from "./styles";

const Joseph: Account = {
  id: "1",
  userName: "Joseph",
  email: "",
  lastname: "Vidal",
  firstname: "Joseph",
  password: "",
  role: 1
}

const list: Basket[] = [
  {
    id: 1,
    accountId: "1",
    account: Joseph,
    productId: 1,
    quantity: 1,
    deliveryOpt: 1,
    currentState: 0,
    product: {
      id: 1,
      name: "Chaise trop bien",
      price: 800,
      quantity: 1,
      craftsmanId: "0",
      craftsman: {
        id: "0",
        userName: "Jojo",
        role: 1,
        firstname: "Jojo",
        lastname: "Vidul",
        email: "yolo",
        password: ""
      },
      images: [
        "data:image/jpeg;base64,"
      ]
    }
  },{
    id: 2,
    accountId: "1",
    account: Joseph,
    productId: 1,
    quantity: 1,
    deliveryOpt: 1,
    currentState: 0,
    product: {
      id: 2,
      name: "Chaise trop nulle",
      price: 10,
      quantity: 1,
      craftsmanId: "0",
      craftsman: {
        id: "0",
        userName: "Jojo",
        role: 1,
        firstname: "Jojo",
        lastname: "Vidul",
        email: "yolo",
        password: ""
      }
    }
  }
];

const BasketView: FC = () => {
  const [basket, setBasket] = useState<Basket[]>(list);
  const [address, setAddress] = useState<string>("");
  const [hasDelivery, setHasDelivery] = useState<boolean>(false);
  const [deliveryCost, setDeliveryCost] = useState<number>(0);

  useEffect(() => {
      setHasDelivery(basket.find((product) => product.deliveryOpt === DeliveryOption.NUMBER_0) !== undefined);
      setDeliveryCost(basket.filter((product) => product.deliveryOpt === 0).length * 50)
    }, [basket]);

  const displayProduct = (basketItem: Basket) => (
    <ProductWrapper key={basketItem.id}>
      <ImageWrapper>
        {(basketItem.product.images && basketItem.product.images?.length !== 0) && <img src={basketItem.product.images[0]} alt=""/>}
      </ImageWrapper>
      <ProductDetails>
        <div>{basketItem.product.name}</div>
        <div>
          <div>Quantit:</div>
          <PlusMinus isRight={false} onClick={() => changeQuantity(setBasket, basketItem.id!, basketItem.quantity - 1)}>
            <BsDashLg />
          </PlusMinus>
          <QuantityInput
            value={basketItem.quantity}
            onChange={(value) => changeQuantity(setBasket, basketItem.id!, value.value)}
          />
          <PlusMinus isRight onClick={() => changeQuantity(setBasket, basketItem.id!, basketItem.quantity + 1)}>
            <BsPlusLg />
          </PlusMinus>
        </div>
      </ProductDetails>
      <LeftWrapper>
        <PriceWrapper>
          {`${basketItem.product.price * basketItem.quantity} `}
        </PriceWrapper>
        <Select
          value={basketItem.deliveryOpt}
          onChange={(e) =>
            changeDelivery(setBasket, basketItem.id!, e as DeliveryOption)}
        >
          <Option label="Livraison" value={0} />
          <Option label="Chercher sur place" value={1} />
        </Select>
      </LeftWrapper>
    </ProductWrapper>
  )

  const displayProductBill = (basketItem: Basket) => (
    <ProductBill>
      <div>{basketItem.quantity} x {basketItem.product.name}</div>
      <div>{basketItem.quantity * basketItem.product.price} </div>
    </ProductBill>
  )

  console.log(process.env.PAYPAL_CLIENT);

  return (
    <Wrapper>
      <BasketDeliveryWrapper>
        <Card>
          <CardTitle>Panier ({basket.length})</CardTitle>
          <CardBody>{basket.map(displayProduct)}</CardBody>
        </Card>
        {hasDelivery && (
          <Card isDelivery>
            <CardTitle>Livraison</CardTitle>
            <CardBody>
              Adresse de livraison (numro, rue, code postal, ville, pays):
              <AddressInput onChange={(e) => setAddress(e.target.value)}/>
            </CardBody>
          </Card>
        )}
      </BasketDeliveryWrapper>
      <Card isBill>
        <CardTitle>Facture</CardTitle>
        <Divider />
        <CardBody isBill>
          {hasDelivery && (
            <BillElement>
              <div>Adresse de livraison:</div>
              <TextRight>{address}</TextRight>
            </BillElement>
            )}
          <BillElement>
            <div>Produits:</div>
            {basket.map(displayProductBill)}
          </BillElement>
          {hasDelivery && (
              <BillElement>
                <div>Frais de livraison:</div>
                <ProductBill>
                  <div>{basket.filter((product) => product.deliveryOpt === 0).length} x 50</div>
                  <div>{deliveryCost} </div>
                </ProductBill>
              </BillElement>
          )}
          <BillElement>
            <div>Total:</div>
            <TextRight>{deliveryCost + basket.reduce(
              (previousValue, currentValue) => previousValue + currentValue.quantity * currentValue.product.price, 0)} </TextRight>
          </BillElement>

          <PayPalScriptProvider
            options={{
              "client-id": process.env.PAYPAL_CLIENT || "AS2njRyP911Wh1qJMHVvp79LARHItOkKDO4N8DP7oO-7e8kmSDZImVMUwT3s4NFjkwbKu7l7CYEqx-1g",
              components: "buttons",
              currency: "EUR"
            }}
          >
            <CheckoutButtons basket={basket} total={deliveryCost + basket.reduce(
              (previousValue, currentValue) => previousValue + currentValue.quantity * currentValue.product.price, 0)}
            />
          </PayPalScriptProvider>
        </CardBody>
      </Card>
    </Wrapper>
  )
};

const changeDelivery = (setProducts: SetState<Basket[]>, id: number, delivery: DeliveryOption) => {
    setProducts((prevState) =>
      prevState.map((product) =>
        product.id === id ? {
            ...product,
            deliveryOpt: delivery
          } :
          product
      )
    );
}

const changeQuantity = (setProducts: SetState<Basket[]>, id: number, quantity: number | null) => {
  if (quantity === null || quantity === 0) {
    setProducts((prevState) => prevState.filter((product) => product.id !== id))
  }
  else
    setProducts((prevState) =>
      prevState.map((product) =>
        product.id === id ? {
        ...product,
          quantity
      } :
          product
      )
    );
}

export default BasketView;
